import React from "react";
import Flip from "react-reveal/Flip";

const styles = theme => ({
  number: {
    color: "red"
  }
});

class NumberCrunch extends React.Component {
  render() {
    return (
      <div>
        <h1>Allein in Europa jeden Tag</h1>
        <Flip left cascade>
          <h1>50.000</h1>
        </Flip>
        <h1>Flüge verspätet</h1>
      </div>
    );
  }
}

export default NumberCrunch;
